export const register = (info) => {
   return {
        type:"CREATE_REGISTER",
        info : info
    }

}
export const login = (email,password) => {
    return{
        type:"LOGIN",
        email:email,
        password:password
    }
}

export const addToDo = (id) => {
    return {
        type:"DO",
        id:id
    }
}
export const addAnswers = (answerQestion,id) => {
    return{
        type:"ANSWERQESTION",
        answerQestion:answerQestion,
        id:id
    }
}
